// Login.js
import React from 'react';
import './.css'

function Login() {
    // Handle login functionality
    return (
        <div>
            <h2>Login</h2>
            <form>
                <input type="text" placeholder="Username" />
                <input type="password" placeholder="Password" />
                <button type="submit">Login</button>
            </form>
        </div>
    );
}

export default Login;
